import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Sidebar.module.css'; // Assuming CSS module for styling

const SidebarButton = ({ path, label }) => {
    let navigate = useNavigate();
    return (
        <button className={styles.button} onClick={() => navigate(path)}>
            {label}
        </button>
    );
};

const Sidebar = () => {
    return (
        <aside className={styles.sidebar}>
            <SidebarButton path="/" label="Main" />
            <SidebarButton path="/about" label="About" />
            <SidebarButton path="/settings" label="Settings" />
            {/* Add other buttons as needed */}
        </aside>
    );
};

export default Sidebar;
